import { CSSProperties, forwardRef, useEffect, useImperativeHandle, useRef, useState } from 'react';

import { MENUTOP_OFFSET, redeemOpenTimeLeft } from '../data/Constant';
import { AppendixCountDown } from '../web/AppendixCountDown';
import ClaimButton from '../web/ClaimButton';
import egg_bg2 from '../resources/egg_bg2.png';
import egg_fg from '../resources/egg_fg.png';
import phone_egg_paper_bg from '../resources/phone_egg_paper_bg.png';
import phone_egg_paper_bg_eng from '../resources/phone_egg_paper_bg_eng.png';
import egg_paper_tag from '../resources/egg_paper_tag.png';
import phone_egg_parade from '../resources/phone_egg_parade.png';
import { animate as animatepopmotion } from 'popmotion';
import { animate, cubicBezier } from '../util/AnimationUtil';
import { LANG_CHINESE, LANG_ENGLISH, LANG_JAPANESE } from '../language/LanguageContext';
import { useTranslation2 } from '../language/useTranslation';
import getContentStyle from '../util/ContentStyleUtil';
import { sizzle_title } from '../web/Egg';
import { udScrollTo, udScrollTop } from './ScrollUtil';

let eggParadeTransY = 0;
let eggAni;
const PhoneEgg = forwardRef<any, any>((props, ref) => {

    const rorate = -2; const scale = 1.5; const duration = 800;
    const paperInitTransY = -100;
    const paperInitTransX = -75;
    const egg_icon_scale = 0.85;
    const rootRef = useRef(null as any);
    const contentRef = useRef(null as any);
    const claimButtonRef = useRef(null as any);
    const eggButtonGroupRef = useRef(null as any);
    const eggButtonIconRef = useRef(null as any);
    const eggParadeRef = useRef(null as any);
    const [open, setOpen] = useState(false)
    const [btnScale, setBtnScale] = useState(egg_icon_scale)


    useImperativeHandle(ref, () => ({
        showClaimAni: (position, money, skipAnim = false) => {
            claimButtonRef.current.showAni(money, skipAnim);
        },
        menuTops: () => {
            return rootRef.current.offsetTop ;
        }

    }));

    const openEgg = () => {
        setOpen(true);
        props.onEggShow();

    }

    const aniContent = () => {

        const curS = udScrollTop();
        let targetS = rootRef.current.offsetTop;
        if (targetS > document.documentElement.scrollHeight - document.documentElement.clientHeight) {
            targetS = document.documentElement.scrollHeight - document.documentElement.clientHeight;
        }
        console.log(" document.documentElement.scrollHeight " + document.documentElement.scrollHeight);
        console.log(" document.documentElement.clientHeight " + document.documentElement.clientHeight);
        console.log("scrollToBottom " + targetS);
        animate({
            duration: duration,
            easing: cubicBezier(0, 0, 0.01, 1),
            onUpdate: (value: number) => {
                const s = curS + (targetS - curS) * value;
                udScrollTo({ left: 0, top: s });

                const sc = scale - (scale - 1) * value;

                const transX = paperInitTransX - paperInitTransX * value;
                const transY = paperInitTransY - paperInitTransY * value;

                contentRef.current.style.transform = `translate(${transX}px, ${transY}px) rotate(${rorate}deg) scale(${sc})`;
                contentRef.current.style.opacity = value;
                if (eggParadeRef.current) {
                    eggParadeRef.current.style.transform = `translate(0px, ${100 - 100 * value}%)`;
                }
            },
            onComplete: () => { }
        })
    }



    const OnMouseEnterLeave = (enter: boolean) => {
        if (eggAni) {
            eggAni.stop();
        }
        let curScale = btnScale;
        let tarScale = enter ? 1 : egg_icon_scale;
        eggAni = animatepopmotion({
            from: curScale,
            to: tarScale,
            stiffness: 155,
            damping: 10.6,
            mass: 1,
            onUpdate: progress => {
                setEffButtonScale(progress)
            },
            onComplete: () => {
                if (!enter) {
                    repeatEggAni();
                }
            }
        })

    }

    function setEffButtonScale(scale) {
        // if (eggButtonIconRef.current) {
        //     eggButtonIconRef.current.style.transform = `scale(${scale})`;
        // }
        setBtnScale(scale)
    }


    const repeatEggAni = () => {
        // if (true) { return; }
        let curScale = egg_icon_scale;
        let tarScale = 1;
        if (eggAni) {
            eggAni.stop();
        }
        eggAni = animatepopmotion({
            from: curScale,
            to: tarScale,
            stiffness: 155,
            damping: 10.6,
            mass: 1,
            repeat: Infinity,
            repeatType: 'reverse',
            onUpdate: progress => {
                setEffButtonScale(progress)
            },
            onComplete: () => {

            }
        })
    }
    const initParadeOffset = () => {
        return -140;
    }
    const [paradeBottomOffset, setParadeBottomOffset] = useState(initParadeOffset());

    const resetParadeBottom = () => {
        setParadeBottomOffset(initParadeOffset());
    }

    //>1920 0  >1575 1 else 2
    const [screenLevel, setScreenLevel] = useState(0);
    const resizeUpdate = (e) => {
        // 通过事件对象获取浏览器窗口的高度
        let w = e.target.innerWidth;
        if (w > 1920) {
            setScreenLevel(0);
        } else if (w > 1575) {
            setScreenLevel(1);
        } else {
            setScreenLevel(2);
        }
    };
    useEffect(() => {
        resetParadeBottom()
    }, [screenLevel]);



    useEffect(() => {
        repeatEggAni();

        // 页面刚加载完成后获取浏览器窗口的大小
        let w = window.innerWidth;
        if (w > 1920) {
            setScreenLevel(0);
        } else if (w > 1575) {
            setScreenLevel(1);
        } else {
            setScreenLevel(2);
        }
        // resetParadeBottom();
        // 页面变化时获取浏览器窗口的大小 
        window.addEventListener('resize', resizeUpdate);
        return function unmount() {
            if (eggAni) {
                eggAni.stop();
                eggAni = null;
            }
            // 组件销毁时移除监听事件
            window.removeEventListener('resize', resizeUpdate);
        };
    }, []);

    useEffect(() => {
        if (open) {
            aniContent();
            // setEggParadeTransX(getEggParadeTransX());
            // eggParadeTransY = getEggParadeHeight() / 2
            if (eggAni) {
                eggAni.stop();
            }
        }
    }, [open]);


    const getEggParadeWidth = () => {
        return document.documentElement.clientWidth;
    }

    const getEggParadeHeight = () => {
        return document.documentElement.clientWidth * 2847 / 5962;
    }

    const getEggParadeTransX = () => {
        if (contentRef.current) {
            return -contentRef.current.getBoundingClientRect().x;
        } else {
            return 0;
        }
    }

    const { t, lan } = useTranslation2()
    function getOpacity() {
        if (lan == LANG_JAPANESE) {
            return 0;
        } else {
            return 1;
        }
    }

    const isChinese = lan == LANG_CHINESE;
    const isEnglish = lan == LANG_ENGLISH;

    const { SizzleTipsStyle } = getContentStyle(lan);
    const [eggParadeTransX, setEggParadeTransX] = useState(0);

    const claimAndOpen = (onlyOpen: boolean) => {
        window.open("https://userdao.pro/sizzle", '_blank');
        if (!onlyOpen) {
            props.claim(5);
        }
    }

    let contentStyle: CSSProperties = {
        fontFamily: 'Sthginkra',
        fontStyle: 'italic',
        fontWeight: 400,
        fontSize: 13,
        lineHeight: isChinese ? '140%' : '130%',
        /* or 25px */

        fontFeatureSettings: `'pnum' on, 'lnum' on, 'pcap' on`,

        /* Manifesto/manifesto-purewhite */

        color: '#FFFFFF',
        textAlign: 'start'
    }

    return (
        <div ref={rootRef} style={{
            width: '100%',
            position: 'relative', justifyContent: 'center',
            display: 'flex', flexDirection: 'column', alignItems: 'flex-start',
            opacity: `${getOpacity()}`

        }}>
            {!open ?
                <div style={{
                    width: '100%',
                    height: 300,
                    position: 'relative',
                    justifyContent: 'center', alignItems: 'center',
                    display: 'flex', flexDirection: 'column'

                }}>
                    <div onClick={openEgg} onMouseEnter={() => { OnMouseEnterLeave(true) }} onMouseLeave={() => { OnMouseEnterLeave(false) }} style={{
                        cursor: 'pointer',
                        position: 'relative',
                        width: 84, height: 97,
                        display: 'flex', justifyContent: 'center', alignItems: 'center',
                    }}>
                        <img src={egg_bg2} style={{ width: '100%', height: '100%', position: 'absolute' }} />
                        <img src={egg_fg} ref={eggButtonIconRef} style={{ width: 50, height: 50, marginTop: 10, zIndex: 1, transform: `scale(${btnScale})` }} />
                    </div>
                </div>
                :
                <div style={{
                    position: 'relative', width: '100%', display: 'flex', alignItems: 'center', justifyContent: 'center'
                }}>
                    <div ref={contentRef} style={{
                        paddingLeft: isEnglish ?40:39,
                        paddingRight: isEnglish ?26:24,
                        width: (isEnglish ?(375-40-26):(370-39-24)), marginTop: 20,
                        height: isEnglish ? 698 : 626,marginBottom:50,
                        transform: `rotate(${rorate}deg)`,
                        position: 'relative',
                        display: 'flex', flexDirection: 'column',
                        backgroundImage: `url(${isEnglish ? phone_egg_paper_bg_eng : phone_egg_paper_bg})`,
                        backgroundSize: '100% 100%',
                    }}>
                        <img src={egg_paper_tag} style={{ position: 'absolute', top: -4, left: 23, width: 36, height: 37 }} />
                        <img src={phone_sizzle_title} style={{ width: 332, height: 97, marginTop: 13, marginLeft: -13 }} />

                        <div style={{ ...contentStyle, marginTop: isEnglish ? -15 : 0 }}>
                            {t('egg_c1')}
                        </div>

                        <div style={{ ...contentStyle, marginTop: isEnglish ? 10 : 14 }}>
                            {t('egg_c2')}
                        </div>

                        <div style={{ ...contentStyle, marginTop: isEnglish ? 10 : 14 }}>
                            {t('egg_c3')}
                        </div>

                        <div style={{ ...contentStyle, marginTop: isEnglish ? 10 : 14 }}>
                            {`${t('egg_c3_1')} 
                            ${t('egg_c3_2')}`}
                        </div>
                        <div style={{ ...contentStyle, marginTop: isEnglish ? 15 : 21 }}>
                            {t('egg_c4')}<br />
                            {t('egg_c5')}<br />
                            {t('egg_c6')}
                        </div>
                        <div style={{ ...contentStyle, marginTop: isEnglish ? 10 : 14 }}>
                            {t('egg_c7')}<br />
                            {t('egg_c8')}
                        </div>
                        <div style={{ ...contentStyle, marginTop: isEnglish ? 10 : 14 }}>
                            {t('egg_c9')}
                        </div>
                        <div style={{ ...contentStyle, marginTop: isEnglish ? 10 : 14 }}>
                            {t('egg_c10')}<br />
                            {t('egg_c11')}
                        </div>

                        <div style={{ ...contentStyle, marginTop: 14, display: 'flex' }}>
                            <AppendixCountDown duration={redeemOpenTimeLeft() / 1000} phone={true} />
                        </div>

                        <div style={{ ...contentStyle, marginTop: isEnglish ? 10 : 14 }}>
                            {t('egg_c12')}
                        </div>

                        {isChinese ?
                            <div style={{ ...SizzleTipsStyle, fontSize: 10, marginTop: 10, width: '100%', display: 'flex', flexDirection: 'column', alignItems: 'flex-start' }}>
                                {t('egg_c13_p')}
                                <div style={{ width: '100%', display: 'flex', color: '#868686' }}>
                                    <div style={{ marginTop: -3.5 }}>
                                        <ClaimButton link={true} textStyle={{ fontSize: 10 }} ref={claimButtonRef} label="userdao.pro/sizzle" position={5} onClaimClick={() => { claimAndOpen(false); }} onAniDone={() => { props.onAniDone(5) }} onLinkClick={() => { claimAndOpen(true); }} />
                                    </div> <span style={{ textIndent: 0 }}>   {t('egg_c15')}</span></div>
                            </div> :
                            <div style={{ ...SizzleTipsStyle, fontSize: 10, marginTop: 10, width: '100%', display: 'flex', flexDirection: 'column', alignItems: 'flex-start',fontWeight:300 }}>
                                {`${t('egg_c13_1')}${t('egg_c13_2')}`}

                                <div style={{ width: '100%', display: 'flex', color: '#868686',fontWeight:400 }}>
                                    <div style={{ marginTop: -3.5 }}><ClaimButton link={true} textStyle={{ fontSize: 10,fontWeight:900 }} ref={claimButtonRef} label="userdao.pro/sizzle" position={5} onClaimClick={() => {
                                        claimAndOpen(false);
                                    }} onAniDone={() => { props.onAniDone(5) }} onLinkClick={() => { claimAndOpen(true); }} /></div>
                                    <span style={{ textIndent: 0}}>   {t('egg_c15')}</span></div>
                            </div>}

                    </div>
                    {/* 2560 × 713 */}
                    <img src={phone_egg_parade}
                        ref={eggParadeRef}
                        style={{ width: 390, height: 380, position: 'absolute', bottom: paradeBottomOffset, zIndex: -100, left: 'calc((100% - 390px)/2)' }} />

                </div>
            }
        </div>
    );
});
export default PhoneEgg;

